var title_f10_53_11095="Ureteral stent placement";
var content_f10_53_11095=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F58468&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F58468&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 540px\">",
"   <div class=\"ttl\">",
"    Ureteral stent placement",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 520px; height: 661px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The ureteral orifice is first identified (A), and cannulated with a guidewire (B). The guidewire is placed beyond the area of obstruction and into the renal pelvis (C). A ureteral access catheter is placed over the guidewire, the guidewire is removed and contrast is injected to opacify the renal pelvis aiding accurate stent placement (D). The guidewire is replaced into the renal pelvis through the access catheter, which is then removed (not shown). The red metal-tipped pusher is used to maneuver the stent over the wire and up the ureter (E). The end of the ureteral stent can be seen at the bladder neck. Finally, the wire is removed and the stent is fully deployed (F). A full pigtail curl should be visualized in the bladder. Fluoroscopy can also be used to verify an adequate curl in the renal pelvis (not shown).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Sutchin Patel, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
