var title_f10_53_11097="Arterial switch operation";
var content_f10_53_11097=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F60625&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F60625&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Arterial switch operation for transposition of the great arteries",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 656px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Surgical technique of the arterial switch operation.",
"    <br>",
"     (A) Aortic cannula is positioned distally in the ascending aorta, the ductus arteriosus is divided between suture ligatures, and the branch pulmonary arteries are dissected out to the hilum to provide adequate mobility for anterior translocation. The broken lines represent the levels of transection of the aorta and the main pulmonary artery. Marking sutures are placed in the anticipated sites of coronary transfer.",
"     <br>",
"      (B) Transection of the great arteries. The left ventricular outflow tract, neoaortic valve, and coronary arteries are thoroughly inspected.",
"      <br>",
"       (C) The coronary arterial buttons are excised from the free edge of the aorta to the base of the sinus of Valsalva.",
"       <br>",
"        (D) The coronary buttons are anastomosed to V-shaped excisions made in the neoaorta.",
"        <br>",
"         (E) The pulmonary artery is brought anterior to the aorta (Lecompte maneuver). Anastomosis of the proximal neoaorta is shown.",
"         <br>",
"          (F) The coronary donor sites are filled with autologous pericardial patches. A single U-shaped patch (F) or two separate patches (G) may be used.",
"          <br>",
"           (H) Anastomosis of the proximal neopulmonary artery and the distal pulmonary artery.",
"           <div class=\"footnotes\">",
"           </div>",
"           <div class=\"reference\">",
"            Reproduced from: Castaneda AR. Anatomic correction of the transposition of the great arteries at the arterial level. In: Surgery of the Chest, Sabiston DC Jr, Spencer FC (Eds), WB Saunders, Philadelphia 1990. Illustrations used with the permission of Elsevier Inc. All rights reserved.",
"           </div>",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
