var content_f10_53_11101=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F63628&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F63628&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Considerations for individualizing antihypertensive therapy",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Indication",
"       </td>",
"       <td class=\"subtitle1\">",
"        Antihypertensive drugs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Compelling indications (major improvement in outcome independent of blood pressure)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Systolic heart failure",
"       </td>",
"       <td>",
"        ACE inhibitor or ARB, beta blocker, diuretic, aldosterone antagonist*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Post-myocardial infarction",
"       </td>",
"       <td>",
"        ACE inhibitor, beta blocker, aldosterone antagonist",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Proteinuric chronic kidney disease",
"       </td>",
"       <td>",
"        ACE inhibitor and/or ARB",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Angina pectoris",
"       </td>",
"       <td>",
"        Beta blocker, calcium channel blocker",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Atrial fibrillation rate control",
"       </td>",
"       <td>",
"        Beta blocker, nondihydropyridine calcium channel blocker",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Atrial flutter rate control",
"       </td>",
"       <td>",
"        Beta blocker, nondihydropyridine calcium channel blocker",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Likely to have a favorable effect on symptoms in comorbid conditions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Benign prostatic hypertrophy",
"       </td>",
"       <td>",
"        Alpha blocker",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Essential tremor",
"       </td>",
"       <td>",
"        Beta blocker (noncardioselective)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hyperthyroidism",
"       </td>",
"       <td>",
"        Beta blocker",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Migraine",
"       </td>",
"       <td>",
"        Beta blocker, calcium channel blocker",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Osteoporosis",
"       </td>",
"       <td>",
"        Thiazide diuretic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Perioperative hypertension",
"       </td>",
"       <td>",
"        Beta blocker",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Raynaud's syndrome",
"       </td>",
"       <td>",
"        Dihydropyridine calcium channel blocker",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Contraindications",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Angioedema",
"       </td>",
"       <td>",
"        ACE inhibitor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Bronchospastic disease",
"       </td>",
"       <td>",
"        Beta blocker",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Depression",
"       </td>",
"       <td>",
"        Reserpine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Liver disease",
"       </td>",
"       <td>",
"        Methyldopa",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Pregnancy",
"       </td>",
"       <td>",
"        ACE inhibitor, ARB (includes women likely to become pregnant)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Second or third degree heart block",
"       </td>",
"       <td>",
"        Beta blocker, nondihydropyridine calcium channel blocker",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        May have adverse effect on comorbid conditions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Depression",
"       </td>",
"       <td>",
"        Beta blocker, central alpha agonist",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Gout",
"       </td>",
"       <td>",
"        Diuretic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hyperkalemia",
"       </td>",
"       <td>",
"        Aldosterone antagonist, ACE inhibitor, ARB",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hyponatremia",
"       </td>",
"       <td>",
"        Thiazide diuretic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Renovascular disease",
"       </td>",
"       <td>",
"        ACE inhibitor or ARB",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * A survival benefit from an aldosterone antagonist has only been demonstrated in patients with advanced heart failure; in patients with less severe disease, an aldosterone antagonist is primarily given for hypokalemia",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from The Seventh Report of the Joint National Committee on Prevention, Detection, Evaluation, and Treatment of High Blood Pressure, JAMA 2003; 289:2560.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
